import './about.scss';
import Path from '../Path/path';
import SelfPortrait from '../../assets/SelfPortrait.jpg';

function About() {
  return (
    <div className="About">
      <Path />

      <div className="Portrait">
        <img className="PortraitImage" src={SelfPortrait} alt="Self Portrait" draggable="false"/>

        <svg xmlns="http://www.w3.org/2000/svg" width="20" height="100" viewBox="0 0 20 100">
          <rect id="Portrait1" data-name="Portrait1" width="20" height="20" transform="translate(20 80)" fill="#0e1117"/>
          <rect id="Portrait2" data-name="Portrait2" width="20" height="20" transform="translate(20 60)" fill="#6b6d4e"/>
          <rect id="Portrait3" data-name="Portrait3" width="20" height="20" transform="translate(20 40)" fill="#585528"/>
          <rect id="Portrait4" data-name="Portrait4" width="20" height="20" transform="translate(20 20)" fill="#919539"/>
          <rect id="Portrait5" data-name="Portrait5" width="20" height="20" transform="translate(20 0)" fill="#c0ba7f"/>
        </svg>
      </div>

      This is the About page.
    </div>
  )
}

export default About
